import {Typography} from '@material-ui/core';
import useStyles from "./styles"
import header from "./header.svg"

const AdminHeader = () => {
    const classes = useStyles();
    return (
        <>
        <div style={{display:"flex"}}>
        <img src={header} 
           style={{
               width:"3000px",
               height:"300px",
               margin:"20px"

           }}
           alt="Hero img"/>
        </div>

        </>
    )
}

export default AdminHeader
